import React from "react";
import { robots } from "./robots";

const RoboCard = () => {

return (
		robots.map((user, i) => {
			return (
					<div className="dib bg-light-green ma2 grow br3 pa4 bw2 shadow-5">
						<img alt="robots" src="https://robohash.org/{i}" />
						<h2>{robots[i].name}</h2>
						<p>{robots[i].email}</p>
					</div>
				)
		}
	)
	)
}

export default RoboCard;
